import React, { Component } from "react";
import {Card,CardTitle,CardText,CardActions,Button,CardMenu,IconButton} from "react-mdl";

class PCard extends Component {
  render() {
    return (
      <div >
        {/* Project */}
        <Card shadow={5} style={{ minWidth: "450", margin: "auto" }}>
          <CardTitle
            style={{
              color: "#fff",
              height: "176px",
              background:
                "url(http://www.picks.org/wp-content/uploads/2014/10/img_0439.jpg) center / cover"
            }}
          >
        
          </CardTitle>
          <CardText>
            Collaborated with a team to develop a dashboard which represents NFL
            predictions by web scraping NFL statistic and running the data
            through Scikit-Learn which is Python AI library
          </CardText>
          <CardActions border>
            <Button colored>
              <a href={this.props.github}>GitHub</a>
            </Button>
            <Button colored>
              <a href={this.props.demo}>Live Demo</a>
            </Button>
            <Button colored>
              <a href="/nfl">More Info</a>
            </Button>
          </CardActions>
          <CardMenu style={{ color: "#fff" }} />
        </Card>
      </div>
    );
  }
}

export default CardProject;
